func maxEqualRowsAfterFlips(matrix [][]int) int {

	column := len(matrix[0])

	res := make(map[string]int, column)

	var firstZero bool
	for _, ints := range matrix {
		if ints[0] == 0 {
			firstZero = true
		} else {
			firstZero = false
		}

		if firstZero {
			var s string
			for _, i := range ints {
				if i == 0 {
					s += "0"
				} else {
					s += "1"
				}
			}
			res[s]++
		} else {
			var s string
			for _, i := range ints {
				if i == 0 {
					s += "1"
				} else {
					s += "0"
				}
			}
			res[s]++
		}
	}

	max := 0
	for _, s := range res {

		if s > max {
			max = s
		}
	}

	return max
}
